import React, { useState } from 'react';
import styled from 'styled-components';
import { motion, AnimatePresence } from 'framer-motion';
import { 
  Calendar, 
  BookOpen, 
  Clock, 
  TrendingUp, 
  Users, 
  Star,
  Download,
  RefreshCw,
  ChevronDown,
  ChevronRight,
  CheckCircle,
  AlertCircle,
  Info
} from 'lucide-react';

const ResultsContainer = styled.div`
  max-width: 1000px;
  margin: 0 auto;
`;

const ActionBar = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 2rem;
  padding: 1rem;
  background: #f8fafc;
  border-radius: 0.75rem;
`;

const ActionButtons = styled.div`
  display: flex;
  gap: 1rem;
`;

const ActionButton = styled.button`
  background: ${props => props.variant === 'primary' ? 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)' : '#f1f5f9'};
  color: ${props => props.variant === 'primary' ? 'white' : '#475569'};
  border: none;
  padding: 0.75rem 1.5rem;
  border-radius: 0.5rem;
  font-weight: 500;
  cursor: pointer;
  transition: all 0.2s ease;
  display: flex;
  align-items: center;
  gap: 0.5rem;

  &:hover {
    transform: translateY(-1px);
    box-shadow: 0 4px 12px -2px rgba(0, 0, 0, 0.1);
  }
`;

const PlanInfo = styled.div`
  background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
  color: white;
  padding: 1.5rem;
  border-radius: 1rem;
  margin-bottom: 2rem;
  text-align: center;
`;

const PlanTitle = styled.h2`
  font-size: 1.5rem;
  font-weight: 700;
  margin-bottom: 0.5rem;
`;

const PlanSubtitle = styled.p`
  opacity: 0.9;
  font-size: 1.125rem;
`;

const SemestersContainer = styled.div`
  display: flex;
  flex-direction: column;
  gap: 1.5rem;
`;

const SemesterCard = styled(motion.div)`
  background: white;
  border: 1px solid #e2e8f0;
  border-radius: 1rem;
  overflow: hidden;
  box-shadow: 0 2px 4px -1px rgba(0, 0, 0, 0.06);
  transition: all 0.2s ease;

  &:hover {
    box-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1);
  }
`;

const SemesterHeader = styled.div`
  background: #f8fafc;
  padding: 1.5rem;
  border-bottom: 1px solid #e2e8f0;
  cursor: pointer;
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const SemesterInfo = styled.div`
  display: flex;
  align-items: center;
  gap: 1rem;
`;

const SemesterTitle = styled.h3`
  font-size: 1.25rem;
  font-weight: 600;
  color: #1a202c;
`;

const SemesterMeta = styled.div`
  display: flex;
  gap: 1rem;
  font-size: 0.875rem;
  color: #64748b;
`;

const MetaItem = styled.div`
  display: flex;
  align-items: center;
  gap: 0.25rem;
`;

const DifficultyBadge = styled.div`
  background: ${props => {
    switch (props.level) {
      case 'Easy': return '#dcfce7';
      case 'Medium': return '#fef3c7';
      case 'Hard': return '#fed7aa';
      case 'Very Hard': return '#fecaca';
      default: return '#f1f5f9';
    }
  }};
  color: ${props => {
    switch (props.level) {
      case 'Easy': return '#166534';
      case 'Medium': return '#92400e';
      case 'Hard': return '#c2410c';
      case 'Very Hard': return '#dc2626';
      default: return '#475569';
    }
  }};
  padding: 0.25rem 0.75rem;
  border-radius: 1rem;
  font-size: 0.75rem;
  font-weight: 600;
  text-transform: uppercase;
`;

const ToggleButton = styled.button`
  background: none;
  border: none;
  color: #64748b;
  cursor: pointer;
  padding: 0.5rem;
  border-radius: 0.25rem;
  transition: all 0.2s ease;

  &:hover {
    background: #e2e8f0;
  }
`;

const SemesterContent = styled(motion.div)`
  padding: 1.5rem;
`;

const CoursesGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
  gap: 1rem;
`;

const CourseCard = styled.div`
  background: #f8fafc;
  border: 1px solid #e2e8f0;
  border-radius: 0.75rem;
  padding: 1rem;
  transition: all 0.2s ease;

  &:hover {
    background: #f1f5f9;
    border-color: #cbd5e0;
  }
`;

const CourseHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: start;
  margin-bottom: 0.75rem;
`;

const CourseCode = styled.div`
  font-weight: 600;
  color: #1a202c;
  font-size: 1.125rem;
`;

const CourseCredits = styled.div`
  background: #667eea;
  color: white;
  padding: 0.25rem 0.5rem;
  border-radius: 0.25rem;
  font-size: 0.75rem;
  font-weight: 600;
`;

const CourseTitle = styled.div`
  color: #4a5568;
  font-size: 0.875rem;
  margin-bottom: 0.75rem;
  line-height: 1.4;
`;

const CourseMeta = styled.div`
  display: flex;
  flex-wrap: wrap;
  gap: 0.5rem;
  margin-bottom: 0.75rem;
`;

const CourseTag = styled.div`
  background: ${props => {
    switch (props.category) {
      case 'Core CS': return '#dbeafe';
      case 'Math': return '#fef3c7';
      case 'Science': return '#dcfce7';
      case 'General Education': return '#f3e8ff';
      case 'Elective': return '#fce7f3';
      default: return '#f1f5f9';
    }
  }};
  color: ${props => {
    switch (props.category) {
      case 'Core CS': return '#1e40af';
      case 'Math': return '#92400e';
      case 'Science': return '#166534';
      case 'General Education': return '#7c3aed';
      case 'Elective': return '#be185d';
      default: return '#475569';
    }
  }};
  padding: 0.25rem 0.5rem;
  border-radius: 0.25rem;
  font-size: 0.75rem;
  font-weight: 500;
`;

const CourseStats = styled.div`
  display: flex;
  justify-content: space-between;
  font-size: 0.75rem;
  color: #64748b;
`;

const StatItem = styled.div`
  display: flex;
  align-items: center;
  gap: 0.25rem;
`;

const PrerequisitesList = styled.div`
  margin-top: 0.75rem;
  padding-top: 0.75rem;
  border-top: 1px solid #e2e8f0;
`;

const PrerequisitesTitle = styled.div`
  font-size: 0.75rem;
  font-weight: 600;
  color: #64748b;
  margin-bottom: 0.5rem;
`;

const PrerequisitesItems = styled.div`
  display: flex;
  flex-wrap: wrap;
  gap: 0.25rem;
`;

const PrerequisiteTag = styled.span`
  background: #e2e8f0;
  color: #475569;
  padding: 0.125rem 0.375rem;
  border-radius: 0.25rem;
  font-size: 0.625rem;
  font-weight: 500;
`;

const EmptyState = styled.div`
  text-align: center;
  padding: 3rem 1rem;
  color: #64748b;
`;

const EmptyStateIcon = styled.div`
  width: 64px;
  height: 64px;
  background: #f1f5f9;
  border-radius: 1rem;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 0 auto 1rem;
  color: #94a3b8;
`;

const EmptyStateTitle = styled.h3`
  font-size: 1.25rem;
  font-weight: 600;
  margin-bottom: 0.5rem;
  color: #374151;
`;

const EmptyStateDescription = styled.p`
  font-size: 1rem;
  line-height: 1.5;
`;

function DegreePlanResults({ degreePlan, onRegenerate, onDownload }) {
  const [expandedSemesters, setExpandedSemesters] = useState(new Set());

  const toggleSemester = (semesterIndex) => {
    const newExpanded = new Set(expandedSemesters);
    if (newExpanded.has(semesterIndex)) {
      newExpanded.delete(semesterIndex);
    } else {
      newExpanded.add(semesterIndex);
    }
    setExpandedSemesters(newExpanded);
  };

  const getDifficultyLevel = (difficultyScore) => {
    if (difficultyScore >= 80) return 'Very Hard';
    if (difficultyScore >= 60) return 'Hard';
    if (difficultyScore >= 40) return 'Medium';
    return 'Easy';
  };

  const getWorkloadLevel = (workloadScore) => {
    if (workloadScore >= 80) return 'Very Heavy';
    if (workloadScore >= 60) return 'Heavy';
    if (workloadScore >= 40) return 'Medium';
    return 'Light';
  };

  if (!degreePlan || !degreePlan.semesters) {
    return (
      <EmptyState>
        <EmptyStateIcon>
          <AlertCircle size={32} />
        </EmptyStateIcon>
        <EmptyStateTitle>No Degree Plan Available</EmptyStateTitle>
        <EmptyStateDescription>
          Please generate a degree plan to see your course schedule.
        </EmptyStateDescription>
      </EmptyState>
    );
  }

  return (
    <ResultsContainer>
      <ActionBar>
        <div>
          <h3 style={{ margin: 0, color: '#1a202c' }}>Your Degree Plan</h3>
          <p style={{ margin: '0.25rem 0 0 0', color: '#64748b', fontSize: '0.875rem' }}>
            Generated on {new Date(degreePlan.generatedAt).toLocaleDateString()}
          </p>
        </div>
        <ActionButtons>
          <ActionButton variant="secondary" onClick={onRegenerate}>
            <RefreshCw size={16} />
            Regenerate
          </ActionButton>
          <ActionButton variant="primary" onClick={onDownload}>
            <Download size={16} />
            Download
          </ActionButton>
        </ActionButtons>
      </ActionBar>

      <PlanInfo>
        <PlanTitle>Computer Science Degree Plan</PlanTitle>
        <PlanSubtitle>
          {degreePlan.semesters.length} semesters â€¢ {degreePlan.totalCreditHours} total credits
        </PlanSubtitle>
      </PlanInfo>

      <SemestersContainer>
        {degreePlan.semesters.map((semester, index) => (
          <SemesterCard key={index}>
            <SemesterHeader onClick={() => toggleSemester(index)}>
              <SemesterInfo>
                <SemesterTitle>
                  {semester.semester} {semester.year}
                </SemesterTitle>
                <SemesterMeta>
                  <MetaItem>
                    <BookOpen size={16} />
                    {semester.totalCreditHours} credits
                  </MetaItem>
                  <MetaItem>
                    <Users size={16} />
                    {semester.courses.length} courses
                  </MetaItem>
                  <MetaItem>
                    <TrendingUp size={16} />
                    <DifficultyBadge level={getDifficultyLevel(semester.difficultyScore)}>
                      {getDifficultyLevel(semester.difficultyScore)}
                    </DifficultyBadge>
                  </MetaItem>
                </SemesterMeta>
              </SemesterInfo>
              <ToggleButton>
                {expandedSemesters.has(index) ? (
                  <ChevronDown size={20} />
                ) : (
                  <ChevronRight size={20} />
                )}
              </ToggleButton>
            </SemesterHeader>

            <AnimatePresence>
              {expandedSemesters.has(index) && (
                <SemesterContent
                  initial={{ height: 0, opacity: 0 }}
                  animate={{ height: 'auto', opacity: 1 }}
                  exit={{ height: 0, opacity: 0 }}
                  transition={{ duration: 0.3 }}
                >
                  <CoursesGrid>
                    {semester.courses.map((course, courseIndex) => (
                      <CourseCard key={courseIndex}>
                        <CourseHeader>
                          <CourseCode>{course.courseCode}</CourseCode>
                          <CourseCredits>{course.creditHours} cr</CourseCredits>
                        </CourseHeader>
                        <CourseTitle>{course.title}</CourseTitle>
                        <CourseMeta>
                          <CourseTag category={course.category}>
                            {course.category}
                          </CourseTag>
                          <CourseTag category="Difficulty">
                            {course.difficultyLevel}
                          </CourseTag>
                          <CourseTag category="Workload">
                            {course.estimatedWorkload}
                          </CourseTag>
                        </CourseMeta>
                        <CourseStats>
                          <StatItem>
                            <Star size={12} />
                            GPA: {course.averageGPA || 'N/A'}
                          </StatItem>
                          <StatItem>
                            <Clock size={12} />
                            {course.estimatedWorkload}
                          </StatItem>
                        </CourseStats>
                        {course.prerequisites && course.prerequisites.length > 0 && (
                          <PrerequisitesList>
                            <PrerequisitesTitle>Prerequisites:</PrerequisitesTitle>
                            <PrerequisitesItems>
                              {course.prerequisites.map((prereq, prereqIndex) => (
                                <PrerequisiteTag key={prereqIndex}>
                                  {prereq}
                                </PrerequisiteTag>
                              ))}
                            </PrerequisitesItems>
                          </PrerequisitesList>
                        )}
                      </CourseCard>
                    ))}
                  </CoursesGrid>
                </SemesterContent>
              )}
            </AnimatePresence>
          </SemesterCard>
        ))}
      </SemestersContainer>
    </ResultsContainer>
  );
}

export default DegreePlanResults;
